INSERT INTO `page_text` (`ID`, `Text`, `NextPageID`, `PlayerConditionID`, `Flags`, `VerifiedBuild`) VALUES
(8609, 'Welcome, friend of the dragonflights.\n\nMay your journeys in the Dragon Isles bring you tranquility, confidence, and camaraderie.\n\nWhile you travel these isle, reflect on the... <this portion of the tablet has broken off.>\n\n... remember our oaths to Azeroth, symbolized in the Oathstones at the seats of power for each dragonflight. We ask... <this portion of the tablet has broken off.>\n\n... For life, and for Azeroth.\n\nAlexstrasza the Life-Binder,\nQueen of the Dragons', 0, 0, 0, 45505); -- 8609
